export default (state = [], action) => {
  console.log('test_redux-reducer')
	switch (action.type) {
		case 'INIT':
			return state;

		case 'LOAD_SCHEDULE':
			return 'Test';

		case 'LOAD_SCHEDULE_FAILURE':
			return null;

		case 'LOAD_SCHEDULE_SUCCESS':
			return action.payload;

		default:
			return state;
	}
};
